  clientId: '916995490002-h4438ccl1o2hth8nk1eipja9ijvo79g6.apps.googleusercontent.com', // e.g. asdfghjkljhgfdsghjk.apps.googleusercontent.com
  clientSecret: 'EEWeOXFIARPTJQ3M0X_DM-sb', // e.g. _ASDFA%DFASDFASDFASD#FAD-
  redirect: 'https://me.jc.com/login' // this must match your google api settings
};

/**
 * Create the google auth object which gives us access to talk to google's apis.
 */

const defaultScope = [
    'https://www.googleapis.com/auth/plus.me',
    'https://www.googleapis.com/auth/userinfo.email',
];



function App() {

  const [name,setName] =useState("");
  const [email,setEmail] =useState("");
  const [url,setUrl] =useState("");

  const responseGoogle = (response) => {
    console.log(response);
    setName(response.profileObj.name);
    setEmail(response.profileObj.email);
    setUrl(response.profileObj.imageUrl);
  }

  return (
    <div class="page1">
      <div class="intro">
        <p class="intro-1">Help build a <br> corona free </br>community</p>
        <p class="intro-2">Inform and be a <br> responsible citizen</br></p>
        <p class="intro-3">Help enforce social distancing <br>and hygiene in your community. </br></p>
      </div>
      <div class ="log">

        <div id="root"></div>
        <br></br>
        <input type="checkbox"  name="identity" id="checkbox" value="No">
           <label id="identity"  for="identity">Keep your identity anonymous</label><br/> </input>

        <a href="#"><p id="skip">Skip Login</p></a>
      </div>
    </div>


  );
}



export default App;
